} pub struct TrustedSetup { proof_key: ProofKey, verification_key: VerificationKey,
} impl TrustedSetup { pub fn generate(g1: &G1Point, g2: &G2Point, t: &Polynomial<Fq>, n: usize) -> Self { let mut rng = rand::thread_rng(); let s = Fq::from_value(rng.gen_bigint_range(&BigInt::zero(), &BigInt::from(std::u32::MAX))); let r = Fq::from_value(rng.gen_bigint_range(&BigInt::zero(), &BigInt::from(std::u32::MAX))); let mut alpha = Vec::with_capacity(n); let mut alpha_prime = Vec::with_capacity(n); let mut s_power = Fq::one(); for _ in 0..1 + n { alpha.push(g1.clone() * s_power.clone().get_value()); alpha_prime.push(g1.clone() * (s_power.clone() * r.clone()).get_value()); s_power = s_power * s.clone(); } let g_r = g2.clone() * r.clone().get_value(); let g_t_s = g2.clone() * t.eval(&s).get_value(); TrustedSetup { proof_key: ProofKey { alpha, alpha_prime }, verification_key: VerificationKey { g_r, g_t_s }, } }
} pub struct Prover { pub p: Polynomial<Fq>, pub h: Polynomial<Fq>,
} impl Prover { pub fn new(p: Polynomial<Fq>, t: Polynomial<Fq>) -> Self { let h = p.clone() / t; Prover { p, h } } pub fn generate_proof(&self, proof_key: &ProofKey) -> Proof { let mut rng = rand::thread_rng(); let delta = Fq::from_value(rng.gen_bigint_range(&BigInt::zero(), &BigInt::from(std::u32::MAX))); let g_p = self.p.eval_with_powers_on_curve(&proof_key.alpha); let g_h = self.h.eval_with_powers_on_curve(&proof_key.alpha); let g_p_prime = self.p.eval_with_powers_on_curve(&proof_key.alpha_prime); Proof { u_prime: g_p * delta.get_value(), v_prime: g_h * delta.get_value(), w_prime: g_p_prime * delta.get_value(), } }
} pub struct Verifier { pub g1: G1Point, pub g2: G2Point,
} impl Verifier { pub fn new(g1: G1Point, g2: G2Point) -> Self { Verifier { g1, g2 } } pub fn verify(&self, proof: &Proof, vk: &VerificationKey) -> bool { // Check e(u', g^r) = e(w', g) let pairing1 = optimal_ate_pairing(&proof.u_prime, &vk.g_r); let pairing2 = optimal_ate_pairing(&proof.w_prime, &self.g2); let check1 = pairing1 == pairing2; // Check e(u', g^t) = e(v', g) let pairing3 = optimal_ate_pairing(&proof.u_prime, &self.g2); let pairing4 = optimal_ate_pairing(&proof.v_prime, &vk.g_t_s); let check2 = pairing3 == pairing4; check1 && check2 }
} pub fn non_interactive_zkp_protocol( prover: &Prover, verifier: &Verifier, setup: &TrustedSetup,
) -> bool { let proof = prover.generate_proof(&setup.proof_key); verifier.verify(&proof, &setup.verification_key)
